import axios from "axios";
// import actions from "./redux/actions";
import { config } from "../../utils/config";

const getQnAData = reqObject => {
  //   actions.setLoader(dispatch, true);
  return axios
    .post(`${config.nlpBaseUrl}`, reqObject)
    .then(res => {
      //   actions.setLoader(dispatch, false);
      if (res.data.Error !== undefined && res.data.Error !== "") {
        return res.data.Error;
      } else {
        return res.data;
      }
    })
    .catch(error => {
      // if (!actions.handle401Error(error)) {
      //   throw error;
      // }
    });
};

export { getQnAData };
